import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Fullundividedpage from './components/Fullundividedpage';

function MainPage() {
  return (
    <section id="content" >
        <section >
            <img src="selfie.png" alt="Tu foto" ></img>
            <h2 class="text-4xl font-bold mb-2">Veronica Sanchez Justicia</h2>
            <p>Full Stack Web Developer, Backend & Frontend | Systems Administrator</p>
            <a href="#experience">
                View Experience
            </a>
        </section>

        <div id="about"></div>
        <div id="experience"></div>
        <div id="skills"></div>
        <div id="education"></div>
        <div id="contact"></div>
        
    </section>
  );
}

export default MainPage;
